function loadStockList(){var n="/Stock/?handler=Json&sortOrder=Latest",t=$.get(n,function(t){console.log(n+" Loaded");numItems=t.stock.length;localStorage.setItem("stocklist",JSON.stringify(t));showStockList()});t.fail(function(){doErrorModal("Error Loading Form "+formToLoad,"The form at "+n+" returned a server error and could not be loaded")})}function showStockList(){let t="",i=JSON.parse(localStorage.getItem("stocklist")),n=i.stock,r=curItem,u=curItem+numItemsToShow;for(let i=r;i<u;i++){let r=i;r>numItems-1&&(r=i-numItems);r<0&&(r=0);t+=`
            <div class="col-md-4">
                <div class="card LatestVehicle">
                    <div class="card-img-top">
                        ${photosHtml(n[r].stocklistImportID,n[r].photo)}
                    </div>
                    <div class="container Details">
                        <div class="row">
                            <div class="col-xl-8 col-6">
                                <h2>${n[r].make} ${n[r].model}</h2>
                            </div>
                            <div class="col-xl-4 col-6 text-right Price">
                                <span>${getPrice(n[r].price)}</span>
                            </div>
                        </div>
                        <div class="row">
                            <div class="col">
                                <h3>${n[r].derivative} (${n[r].manufacturedYear})</h3>
                            </div>
                        </div>
                        <div class="row">
                            <div class="col-6">
                                <i class="fas fa-cogs"></i> ${n[r].transmission}
                            </div>
                            <div class="col-6">
                                <i class="fas fa-tachometer-alt"></i> ${n[r].mileage}${n[r].mileageUnit}
                            </div>
                            <div class="col-6">
                                <i class="fas fa-palette"></i> ${n[r].colour}
                            </div>
                            <div class="col-6">
                                <i class="fas fa-gas-pump"></i> ${n[r].fuelType}
                            </div>
                            <div class="col-6">
                                <i class="fas fa-tools"></i> ${n[r].engineSize}${n[r].engineSizeUnit}
                            </div>
                            <div class="col-6">
                                <i class="fas fa-door-closed"></i> ${n[r].doors}
                            </div>
                            <div class="col-12">
                                <i class="fas fa-users"></i> ${getPreviousOwners(n[r].previousOwners)}
                            </div>
                        </div>
                    </div>
                    <div class="row">
                        <div class="col text-center MoreDetails">
                            <a href="#">Finance from xxx p/m</a>
                        </div>
                    </div>
                </div>
            </div>`}$("#LatestVehicleArea").html(t);listLoadedFunctions()}function advanceStockList(n){n==="R"?(curItem-=1,curItem<0&&(curItem=numItems-1)):(curItem+=1,curItem>numItems-1&&(curItem=0));showStockList()}function animateStockList(){setTimeout(function(){latestCarControlsHover===!1&&advanceStockList("F");animateStockList()},5e3)}function listLoadedFunctions(){$(function(){return $(".carousel.lazy").on("slide.bs.carousel",function(n){var t;t=$(n.relatedTarget).find("img[data-src]");t.attr("src",t.data("src"));t.removeAttr("data-src")})})}loadStockList();animateStockList();var curItem=0,numItems=0,numItemsToShow=3,latestCarControlsHover=!1;$(".LatestCarControls").mouseenter(function(){latestCarControlsHover=!0});$(".LatestCarControls").mouseleave(function(){latestCarControlsHover=!1});$("#LatestVehicleArea").mouseenter(function(){latestCarControlsHover=!0});$("#LatestVehicleArea").mouseleave(function(){latestCarControlsHover=!1});$(".LatestCarControls").click(function(){let n=$(this).attr("aria-label");advanceStockList(n)});